DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `product_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '果蔬唯一标识',
  `product_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '产品名称',
  `product_price` float(8,2) DEFAULT '0.00' COMMENT '单价',
  `product_mainPrice` float(8,2) DEFAULT '0.00' COMMENT '市场价格',
  `product_standard` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '规格描述',
  `product_briefDescription` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '简短描述',
  `product_description` varchar(256) COLLATE utf8_bin DEFAULT NULL COMMENT '描述',
  `product_stock` int(8) DEFAULT '-1' COMMENT '库存',
  `product_limit` int(11) DEFAULT '0',
  `product_saleAmount` int(8) DEFAULT NULL COMMENT '售出数量',
  `product_number` int(8) DEFAULT '0' COMMENT '根据unit来填写值 \r\n 例 danwei 值 0（个数） 则应该填写商品的个数（1）\r\n\r\ndanwei 值 1（重量） 则应填写商品的克数（500）\r\n\r\ndanwei 值 2（分数） 则应填写商品的分数（1）\r\n',
  `product_unit` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '关联dictionaries表中的keyword字段',
  `product_class1` int(2) DEFAULT NULL COMMENT '大分类 对应category表',
  `product_class2` int(5) DEFAULT NULL COMMENT '中分类',
  `product_class3` int(7) DEFAULT NULL COMMENT '小分类',
  `product_headImage` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '首页产品主图地址',
  `product_bannerImage` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '商品banner图',
  `product_detailImage` varchar(128) CHARACTER SET utf8 DEFAULT NULL COMMENT '商品详情图',
  `real_weight` float DEFAULT NULL COMMENT '实际重量',
  `is_combo` int(1) DEFAULT NULL COMMENT '是否为套餐 0套餐 1非套餐',
  `combo_id` int(8) DEFAULT NULL,
  `isactive` int(1) DEFAULT NULL COMMENT '1：参加活动0:无活动',
  `activeId` int(2) DEFAULT NULL COMMENT '活动id',
  `issale` int(1) DEFAULT '0' COMMENT '是否上线0出售1下架',
  `del_flag` int(1) DEFAULT '1' COMMENT '逻辑删除 1不删除  0删除',
  `address` varchar(25) CHARACTER SET utf8 DEFAULT NULL COMMENT '产地',
  `cycle` varchar(25) CHARACTER SET utf8 DEFAULT NULL COMMENT '采购周期',
  `reposition` varchar(25) COLLATE utf8_bin DEFAULT NULL COMMENT '存储',
  `createtime` datetime DEFAULT NULL,
  `modifytime` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `l_product_id` int(11) DEFAULT '0' COMMENT '相对ID',
  PRIMARY KEY (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1000000222 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

